import '../styles/App.css';
import React from 'react';
import axios from 'axios';
import { Link } from 'react-router-dom';
import GlmFileUpload from './GlmFileUpload';
import Graph from './Graph';

const logFiles = (files) => {
  const formData = new FormData();
  for(let i = 0; i < files.length; i++)
  {
    formData.append('glmFile', files[i]);
  }

  var header = {
    header: {
      "content-type": "multipart/form-data"
    }
  };
  axios.post("http://localhost:3001/upload", formData, header)
  .then(res => console.log(res.statusText));

}

const Home = () => {
  return (
    <>
    <header>
        <h1 className="title">Power Grid Model Visualization Tool</h1>
        <nav>
            <ul className="nav-links">
                <li><Link to ="/" style={{ textDecoration: 'none', color: "white" }}>Home</Link></li>
                <li><Link to="/About" style={{ textDecoration: 'none', color: "white"}}>About</Link></li>
            </ul>
        </nav>
    </header>
    <main>
      <GlmFileUpload logFiles = {logFiles}/>
      <Graph display = {'none'}/>
    </main>
    </>
  );
}

export const About = () => {
  return (
    <div>
      <header>
        <h1 className="title">Power Grid Model Visualization Tool</h1>
        <nav>
            <ul className="nav-links">
                <li><Link to ="/" style={{ textDecoration: 'none', color: "white" }}>Home</Link></li>
                <li><Link to="/About" style={{ textDecoration: 'none', color: "white"}}>About</Link></li>
            </ul>
        </nav>
    </header>
      <h1>About The tool</h1>
    </div>
  );
}

export const App = () => {
  return (
    <Home />
  );
}
